import React from 'react'
import {Link} from 'react-router-dom';

const Navbar = () => {
  return (
    <>
      <nav className="navbar">
        <div className="nav-container">
          <Link to="/" className="nav-logo">
            Capgemini
          </Link>
          <div>Hello Capgemini</div>
        </div>
        <h1>Capgemini</h1>
      </nav>
    </>
  )
}

export default Navbar;
